import React, { Component } from 'react';
import './App.css';

const colourList = [
  {
    name: 'Orange Princess',
    hex: '#FFA500',
    price: '25',
    objectID: 0,
  },
  {
    name: 'Michelle',
    hex: '#b0e0e6',
    price: '25',
    objectID: 1,
  },
];

class App extends Component {
  render() {
    return (
      <div className="App">
        {colourList.map(colour =>
          <div key={colour.objectID}>
            <span>
              {colour.name}
            </span>
            <span>
              <div className="colourPeak" width="100px" height="100px" style={{ backgroundColor: colour.hex }}></div>
            </span>
          </div>
        )}
      </div>
    );
  }
}

export default App;
